import './index.css';
import GifContext from '../../context/GifsContext';

export default function Detail({params}) {
  const {gifs} = useContext(GifContext);
  const gif = gifs.find(singleGif => singleGif.id === params.id)
  console.log(gif);

  return <h1>Gif con id: {params.id}</h1>
}
